% A very simple algorithm to perform local weather forecast. It is based on
% the readings of pressure and relative humidity. These are stored un the
% main channel. This script works with derived data (weather condition)
% calculated with another script and written in an auxiliary channel.
% Source (in italian): https://www.meteogiuliacci.it/meteo/articoli/analisi/prevedere-il-tempo-mediante-la-pressione
% Source for the icons graphics: http://www.alessioatzeni.com/meteocons/
% Conversion from picture to MATLAB plot coordinates: https://it.mathworks.com/matlabcentral/fileexchange/54799-convert-image-pixels-to-xy-coordinates

% Aux channel ID, API and fields
ChannelID = 000000; % replace 000000 with your aux Channel ID
readAPIKey = 'myReadAPIkey';  % replace myReadAPIkey with yours (aux)
fieldID = 1;

% Read weather condition from the aux channel
condition = thingSpeakRead(ChannelID,'Fields',fieldID, ...
    'ReadKey',readAPIKey);

% Check if day or night
if hour(datetime('now')) > 6 && hour(datetime('now')) < 18
    dayFlag = 1;
else
    dayFlag = 0;
end

